description:
School of Fish was an alternative rock band which formed in 1989 and disbanded in 1994.

The core members were Josh Clayton-Felt and Michael Ward who would play club dates in Los Angeles, California as a duo accompanied by programmed drums and bass. The band signed with Capitol Records in 1990, and released their first single on that same year on 7-inch vinyl. Their self-titled debut was released in March 1991, followed by their first single, &quot;Three Strange Days.&quot; Also during the same year, they appeared on a KROQ concert disc called the Acoustic Christmas. Their second album, Human Cannonball, was released in 1993. The album did not sell very well and was not as successful as the self-titled album. Shortly thereafter, the band broke up.


